	(748, '_transient_tech_css_cache', '<style type="text/css">/*Variable Styles*/#page{ background:#F7F7F7 url() repeat top center scroll;}body{font: 10px/1.3em arial, Sans-Serif;background:#A0B3C2 url() repeat top center scroll;}.techozoic_font_size{font-size: 10px;}.narrowcolumn .entry,.widecolumn .entry, .top {font: 10px/1.5em arial, Sans-Serif;color: #2C4353;}.noclass,.home .narrowcolumn .entry, home .widecolumn .entry, .top,.archive .narrowcolumn .entry, .archive .widecolumn .entry, .top{background-color:#E3E3E3;border-top:1px #A0B3C2 solid;}.top{border:none;}.blog_title, .blog_title a, .blog_title a:hover, .blog_title a:visited{font:bold 30px/1.3em verdana, Sans-Serif;color: #A0B3C2;}h1.post_title{font:bold 20px/1.4em verdana, Sans-Serif;color:#2C4353 !important;}.post_title a{font:bold 20px/1.4em verdana, Sans-Serif;color:#2C4353 !important;}.entry h1{font:bold 3em/2.2em verdana, Sans-Serif;color: #2C4353 !important;}.entry h2{font:bold 2em/2em verdana, Sans-Serif;color: #2C4353 !important;}.entry h3{font:bold 1.4em/1.6em verdana, Sans-Serif;color: #2C4353 !important;}.entry h4{font:bold 1.3em/1.4em verdana, Sans-Serif;color: #2C4353 !important;}.entry h5{font:bold 1.2em/1.3em verdana, Sans-Serif;color: #2C4353 !important;}.sidebar h2, .sidebar h3, #footer h2{font: bold 16px/1.3em verdana, Sans-Serif;color:#2C4353;}.widgettitle {font-size: 16px;margin: 1px 0;}#content {font-size: 10px;}acronym,abbr,span.caps,small,.trackback li,.sidebar, .postmetadata {font-size: 10px;}.postmetadata{font:10px/1.3em arial, Sans-Serif;color: #777777;}ul#nav a, ul#admin a, #dropdown li.current_page_item a:hover, .top-menu li.current-menu-item a:hover, #dropdown li.current_page_item ul a, .top-menu li.current-menu-item ul a, ul#nav li.current_page_item a:hover, {color: #A0B3C2;}.commenlist .author,#searchform #s, #searchsubmit:hover,#catsubmit:hover,#wp-submit:hover,#TB_ajaxContent {background-color: #A0B3C2 ;}ul#admin li, ul#dropdown li, #navmenu .top-menu li{/*background-color: #E3E3E3;*/}ul#admin li a, ul#dropdown li a, #navmenu .top-menu li a{font-style: bold; font-size:13px;font-family: verdana, Sans-Serif;color:#A0B3C2;}ul#admin li a:hover, ul#dropdown li a:hover, #navmenu .top-menu li a:hover{color: #A0B3C2;}#dropdown > li, ul.top-menu > li{margin: 0 3px;}.ribbon ul.top-menu > li, .square ul.top-menu > li, #dropdown > li{margin: 0;padding: 0 3px;}.ribbon ul.top-menu > li.has_children:hover:after, .square ul.top-menu > li.has_children:hover:after, #dropdown > li.has_children:hover:after {border-bottom: 5px solid #E3E3E3;}#dropdown ul, .top-menu ul{background-color: #E3E3E3;}.ribbon, .square, #dropdown{background-color: #E3E3E3;background-image: -webkit-gradient(linear, 0% 0%, 0% 100%, from(#E3E3E3), to(#CCCCCC));background-image: -webkit-linear-gradient(top, #E3E3E3, #CCCCCC);background-image:-moz-linear-gradient(top, #E3E3E3, #CCCCCC);background-image: -ms-linear-gradient(top, #E3E3E3, #CCCCCC);background-image:-o-linear-gradient(top, #E3E3E3, #CCCCCC);background-image: linear-gradient(top, #E3E3E3, #CCCCCC);filter: progid:DXImageTransform.Microsoft.gradient(startColorstr=\'#E3E3E3\', endColorstr=\'#CCCCCC\');}.ribbon ul.top-menu:before{border-right: 10px solid #CCCCCC;}.ribbon ul.top-menu:after{border-left: 10px solid #CCCCCC;}.ribbon ul.top-menu > li:last-child, .square ul.top-menu > li:last-child, #dropdown > li:last-child{margin-right: 100px;}#navmenu .top-menu li, #navmenu .top-menu ul.sub-menu, ul#admin li, #navmenu #dropdown li{background-color: #E3E3E3;} #navmenu #dropdown li.current_page_item, #navmenu .top-menu li.current-menu-item, #navmenu .top-menu ul.sub-menu li.current-menu-item {background-color: #A0B3C2 ;}#navmenu #dropdown li:hover, #navmenu .top-menu li:hover, #navmenu .top-menu ul.sub-menu > li:hover {background-color:#EFEFEF;}#navmenu #dropdown li.current_page_item > a:hover, #navmenu .top-menu li.current-menu-item > a:hover, #navmenu .top-menu li.current-menu-item:hover > a, #navmenu .top-menu li:hover > a, #navmenu #dropdown li:hover > a {color:#A0B3C2;}#navmenu #dropdown li.current_page_item > a, #navmenu .top-menu li.current-menu-item > a{color:#F7F7F7;}ul#admin li:hover{background:#EFEFEF;box-shadow:2px 1px 3px rgba(0, 0, 0, 0.3);-moz-box-shadow:2px 1px 3px rgba(0, 0, 0, 0.3);-webkit-box-shadow:2px 1px 3px rgba(0, 0, 0, 0.3);}#dropdown li ul li, .top-menu li ul li, #dropdown li ul , .top-menu li ul{width: 250px !important;}#dropdown li ul ul, .top-menu li ul ul{left:250px ; }.tags {border-bottom:1px #A0B3C2 solid;border-top:1px #A0B3C2 solid;}a,h2 a:hover,h3 a:hover,#user_login,#user_pass, #sidenav a:visited {color:#597EAA; text-decoration:none;}#searchform #s {color:#E3E3E3; text-decoration:none;}a:hover {color:#114477; text-decoration:underline;}a:visited{color:#2C4353;}.description {color:#A0B3C2;}#headerimg {;float:left;margin-left:10px;}#header-logo{float:left;margin-left:10px;padding-top:0px;padding-left:0px;}.single .blog_title a:hover {cursor:default;text-decoration:none;}.noclass{-moz-box-shadow:none !important;box-shadow:none !important;-webkit-box-shadow: none !important;opacity:1 !important;border: none !important;}#headerimgwrap{top:20%;}#page {width: 90%}.narrowcolumn {float:left;margin:0 1%;padding:25px 0 20px 0;width:48%;}#r_sidebar {float:right;padding:25px 2% 0 0;width:23%}#l_sidebar {float:left;padding:25px 0 0 2%;width:21%}#dropdown, .top-menu{text-align:left;}#header {background-repeat: no-repeat;background-position: center center;height: 200px;}.hleft, .hright {height: 160px;}</style>', 'no'),
