	(750, '_transient_tech_clarktechnet_twitter', '<ul>\r\n<li class=\'tweet\'>Cause for the downtime last night for my sites. "<a href="http://twitter.com/dhstatus" rel="external" title="DreamHost Status on Twitter">@dhstatus</a>: A Status Update From Our CEO: <a href="http://bit.ly/10eRyNE" rel="external">bit.ly/10eRyNE</a>" - <em>\r\n<a href=\'http://twitter.com/clarktechnet/status/314493040855240705\'>13 дни ago</a></em></li>\r\n<li class=\'tweet\'>Finally got around to adding a decent avatar image. - <em>\r\n<a href=\'http://twitter.com/clarktechnet/status/313864118237016066\'>14 дни ago</a></em></li>\r\n<li class=\'tweet\'>Don\'t call product your trying to get support on crap. It really doesn\'t make me want to help, contrary to what you may think. <a href="http://twitter.com/search?q=%23supportfail" rel="external">#supportfail</a> - <em>\r\n<a href=\'http://twitter.com/clarktechnet/status/311934450986528768\'>20 дни ago</a></em></li>\r\n<li class=\'tweet reply\'>Authenticating accounts and setting up app keys is absurd to list a few tweets from a stupid feed. Stupid Twitter. - <em>\r\n<a href=\'http://twitter.com/Krogsgard/status/311343845394759680\'>21 дни ago</a></em><ul>\r\n<li class=\'tweet\'><a href="http://twitter.com/Krogsgard" rel="external" title="Brian Krogsgard on Twitter">@Krogsgard</a> couldn\'t agree more. I had to pull the Twitter widget from my theme on WP . org because of this. - <em>\r\n<a href=\'http://twitter.com/clarktechnet/status/311432234773118976\'>21 дни ago</a></em></li>\r\n</ul></li>\r\n<li class=\'tweet\'>[Techozoic-Fluid] <a href="https://github.com/jeremyclark13/Techozoic-Fluid/commit/fd627af5840c7baf27ebfedf4db85931a63904ee" rel="external">github.com/jeremyclark13/…</a> Jeremy Clark - Fixed floating issue on single posts - <em>\r\n<a href=\'http://twitter.com/clarktechnet/status/311127952895139840\'>22 дни ago</a></em></li>\r\n</ul>', 'no'),
