chnet.com/?p=200";s:7:"attribs";a:1:{s:0:"";a:1:{s:11:"isPermaLink";s:5:"false";}}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:339:"After a long hiatus from working with the Techozoic theme code, I am now starting to work on the next version. I&#8217;ve made some decisions that might affect some users, but hopefully will be for the better of everyone. The major changes are below: Options Page Custom Headers Only supporting WordPress Menus Only supporting Google [...]";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:32:"http://purl.org/dc/elements/1.1/";a:1:{s:7:"creator";a:1:{i:0;a:5:{s:4:"data";s:12:"Jeremy Clark";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:40:"http://purl.org/rss/1.0/modules/content/";a:1:{s:7:"encoded";a:1:{i:0;a:5:{s:4:"data";s:1654:"<p>After a long hiatus from working with the Techozoic theme code, I am now starting to work on the next version.  I&#8217;ve made some decisions that might affect some users, but hopefully will be for the better of everyone.  The major changes are below:</p>\n<ul>\n<li>Options Page</li>\n<li>Custom Headers</li>\n<li>Only supporting WordPress Menus</li>\n<li>Only supporting Google Fonts</li>\n</ul>\n<p>The first change of the options page, I will be switching from maintaining my own theme options functionality to using the <a href="http://wptheming.com/options-framework-theme/">Options Framework</a>.  What this means for users is that a new look for options but all options should be ported over to the new interface.  I will try to make the transition as seamless as I can but some options might have to be reentered.  </p>\n<p>Second change of using WordPress custom headers, I&#8217;ve had numerous problems trying to maintain my own custom header admin page.  The custom headers from WordPress should cover all the areas that the theme will need.</p>\n<p>I will be phasing out two areas of the theme completely, the first being the navigation options.  The WordPress menu management system is much easier to use.  The second phase out will be Cufon fonts.  The Google Font directory has become very large with many choices and easy to implement.  As a bonus the font files are all hosted with Google&#8217;s vast Content Delivery Network.</p>\n<p>Hopefully these changes will all be for the better.  If anyone would be willing to help beta test when I get closer to release please <a href="http://clark-technet.com/contact-me">contact me here</a>.</p>\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:36:"http://wellformedweb.org/CommentAPI/";a:1:{s:10:"commentRss";a:1:{i:0;a:5:{s:4:"data";s:66:"http://techozoic.clark-technet.com/2011/09/next-version-news/feed/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}s:38:"http://purl.org/rss/1.0/modules/slash/";a:1:{s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:1:"0";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:3;a:6:{s:4:"data";s:42:"\n		\n		\n		\n		\n		\n				\n\n		\n		\n				\n			\n		\n		";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:5:{s:0:"";a:7:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:17:"New Version 1.9.4";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:61:"http://techozoic.clark-technet.com/2011/05/new-version-1-9-4/";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:8:"comments";a:1:{i:0;a:5:{s:4:"data";s:70:"http://techozoic.clark-technet.com/2011/05/new-version-1-9-4/#comments";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Tue, 03 May 2