:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1843:"...\r\n\r\nДори бъркотията около Кипър не му оказа подкрепа. Нито изключително слабите данни за икономиката на САЩ. Нито масовите опасения за възстановяването на глобалната икономика. Цената на златото просто е в застой и металът не успява да върне славата си на спасителен остров.\r\n\r\nТова е причината анализаторите на Goldman Sachs да станат поредните, които ревизират надолу таргета си за цената на златото през тази и следващата година. При това за втори път в рамките на по-малко от два месеца, пише MarketWatch.\r\n\r\nСпоред актуалната прогноза през настоящата година се очаква средна цена 1 545 долара за тройунция, а догодина се очаква спад до 1 350 долара за тройунция. Предишните очаквания баха съответно за 1 610 и 1 490 долара за тройунция.\r\n„Въпреки нарастването на стремежа за избягване на рисковете в еврозоната и разочароващите икономически данни от САЩ, цената на златото остана непроменена през последния месец, показвайки ясно как готовността да се притежава злато бързо изчезва“, коментират в доклада си анализаторите.\r\n\r\n...";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:6:"author";a:1:{i:0;a:5:{s:4:"data";s:5:"peter";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Fri, 12 Apr 2013 05:49:58 +0100";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:235:"http://prognometer.com/прогнози/метали/злато/2416-през-2014-г-средната-цена-на-златото-ще-бъде-1-350-долара-за-тройунция-прогнозират-от-goldman-sachs.html";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:1;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_b