ките.\r\n\r\n...";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:6:"author";a:1:{i:0;a:5:{s:4:"data";s:5:"peter";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Fri, 12 Apr 2013 05:49:49 +0100";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:200:"http://prognometer.com/прогнози/макроикономика/бвп/2413-брутният-вътрешен-продукт-на-германия-да-се-повиши-с-1-7-за-2014-г-.html";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:4;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:1:{s:0:"";a:6:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:97:"Брутният вътрешен продукт на Германия да се повиши ...";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:200:"http://prognometer.com/прогнози/макроикономика/бвп/2412-брутният-вътрешен-продукт-на-германия-да-се-повиши-с-0-6-за-2013-г-.html";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:3019:"...\r\n\r\nИкономисти занижиха очакванията си за икономическия растеж на еврозоната, предаде Ройтерс.\r\n\r\nРезултатите от анкета на информационната агенция сред 60 икономисти сочат, че очакванията са през тази година брутният вътрешен продукт (БВП) на региона да се свие с 0,4%, а не с 0,1%, каквито бяха прогнозите само преди 3 месеца.\r\n\r\nЕкспертите посочват също така, че безработицата в еврозоната, която е на рекордно високи равнища, ще продължи да нараства и вероятно ще достигне пикови нива към края на тази и началото на следващата година. Според прогнозата безработицата ще достигне 12,4% към края на годината.\r\n\r\nПовечето от анализаторите са на мнение, че еврозоната ще успее да излезе от рецесията през тази година, но очакванията им са растежът да остане малко над нулата поне през следващите 12 месеца.\r\n\r\nСпоред икономистите Германия ще бъде основен двигател на растежа и излизането от еврозоната в никакъв случай няма да означава, че европейската валутна общност се връща към просперитет. За цялата година се очаква БВП на Германия да се повиши с 0,6% заради предпазливите потребители и забавянето на износа. Ускоряване на растежа се очаква през следващата година – до 1,7%.\r\n\r\nПо-песимистични са очакванията на Франция и Италия, като прогнозите са за задълбочаване на рецесията и продължаващ ръст на публичния дълг.\r\n\r\nПовечето от участниците в анкетата заявяват също така, че очакват Европейската централна банка (ЕЦБ) да обяви допълнителни стимули за икономиката. Най-популярните предложения за по-нататъшни действия на ЕЦБ са за програма, която да стимулира кредитирането за малките и средни предприятия, както и нов кръг от евтини тригодишни заеми за банките.\r\n\r\n...";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:6:"author";a:1:{i:0;a:5:{s:4:"data";s:5:"peter";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Fri, 12 Apr 2013 05:49:47 +0100";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:200:"http://prognometer.com/прогнози/макроикономика/бвп/2412-брутният-вътрешен-продукт-на-германия-да-се-повиши-с-0-6-за-2013-г-.html";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:5;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:1:{s:0:"";a:6:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:97:"Безр