ване на БВП с 1.1%.\r\n\r\n...";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:6:"author";a:1:{i:0;a:5:{s:4:"data";s:5:"peter";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Fri, 12 Apr 2013 05:49:32 +0100";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:303:"http://prognometer.com/прогнози/макроикономика/бвп/2407-през-2013-г-се-очаква-икономиката-на-кипър-да-се-свие-с-8-7-се-прогнозира-в-доклад-на-тройката-големи-кредитори-на-страната.html";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:10;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:1:{s:0:"";a:6:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:85:"През 2013 г. световната търговия ще нарасне с 3. ...";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:288:"http://prognometer.com/прогнози/индустриални-сектори/търговия/2406-през-2013-г-световната-търговия-ще-нарасне-с-3-3-прогнозират-от-световната-търговска-организация-(сто).html";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:2695:"...\r\n\r\nСветовната търговска организация (СТО) понижи прогнозата си за глобалната търговия през тази година, като предупреди, че се опасява от засилване на протекционизма, предаде Ройтерс.\r\n\r\nСпоред актуализираната прогноза световната търговия ще нарасне с 3,3% през тази година, докато предишната прогноза беше за растеж от 4,5 на сто.\r\n\r\nОрганизацията отчете също така, че през 2012 г. световната търговия е отчела ръст от 2%. Това е най-слабото годишно увеличение откакто организацията води статистика (от 1981 г.) и най-лошият резултат от 2009 г., когато обаче беше отчетено свиване на търговията в глобален мащаб.\r\n\r\nГенералният директор на СТО Паскал Лами предупреди, че ситуацията през тази година може да се влоши дори повече заради рисковете, свързани с кризата в еврозоната. От друга страна някои държави може да се опитат да наложат допълнителни ограничения пред международната търговия в опит да насърчат вътрешния растеж.\r\n\r\n„Опасността от протекционизъм може би е най-голяма сега, отколкото когато и да било по време на кризата, след като се направи опит да бъдат въведени всякакви политики за възстановяване на растежа“, коментира Лами.\r\n\r\nОчакванията са годишните ръстове на световната търговия да останат под средните стойности в дългосрочен план, прогнозират още от СТО. Очакванията на организацията се базират на прогноза за 2,1% ръст на глобалния брутен вътрешен продукт през 2013 г. - консенсусна оценка, която според организацията е останала непроменена от миналата година.\r\n\r\n...";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:6:"author";a:1:{i:0;a:5:{s:4:"data";s:5:"peter";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Thu, 11 Apr 2013 05:26:45 +0100";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:288:"http://prognometer.com/прогнози/индустриални-сектори/търговия/2406-през-2013-г-световната-търговия-ще-нарасне-с-3-3-прогнозират-от-световната-търговска-организация-(сто).html";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:11;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:1:{s:0:"";a:6:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:83:"Дунав мост 2 ще бъде пуснат до края на 05.2013 г. ...";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:255:"http://prognometer.com/прогнози/индустриални-сектори/транспорт/2405-дунав-мост-2-ще-бъде-пуснат-до-края-на-05-2013-г-съобщи-президентът-росен-плевнелиев.html";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:745:"...\r\n\r\nДунав мост 2 ще бъде пуснат до края на месец май. За това съобщи държавният глава Росен Плевнелиев по време на днешното си посещение в Русе. Плевнелиев и министърът на транспорта, информационните технологии и съобщенията Кристиан Кръстев се запознаха на място със състоянието на съоръжението, както и с предприетите мерки за ограничаване на риска от наводнение след повишаването на нивото на реката.\r\n\r\n...";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:6:"author";a:1:{i:0;a:5:{s:4:"data";s:5:"peter";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Thu, 11 Apr 2013 05:26:43 +0100";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:255:"http://prognometer.com/прогнози/индустриални-сектори/транспорт/2405-дунав-мост-2-ще-бъде-пуснат-до-края-на-05-2013-г-съобщи-президентът-росен-плевнелиев.html";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:12;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:1:{s:0:"";a:6:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:96:"До края на 2013 г. безработицата в САЩ ще се понижи до ...";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:300:"http://prognometer.com/прогнози/безработица-и-заетост/2404-до-края-на-2013-г-безработицата-в-сащ-ще-се-понижи-до-около-7-прогнозира-президентът-на-фед-в-сейнт-луис-джеймс-булард.html";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1814:"...\r\n\r\nПрезидентът на Федералния резерв (Фед) в Сейнт Луис Джеймс Булард заяви пред CNBC, че  е склонен да свие масивната програма за вливане на ликвидност на централната банка „на малки стъпки“.\r\n\r\nБулард подчертава, че той би застанал зад подобно решение, ако икономиката продължава да се възстановява. За момента Фед изкупува облигации на стойност 85 млрд. долара на месец.\r\n\r\n„Можете да коригирате QE или нагоре или надолу. Икономиката обаче най-вероятно ще продължава да укрепва и ние ще се окажем в позиция постепенно да забавим темпа на монетарните стимули“, изтъква той.\r\n\r\n...\r\n\r\nОфициално Фед настоява, че е необходимо „чувствително подобрение“ на пазара на труда – безработица не по-голяма от 6,5% - преди програмата за вливане на ликвидност да бъде забавена или спряна.\r\n\r\nБулард обаче признава, че съществуват някои рискове в това централната банка да обвързва политиката си с безработицата.\r\n\r\nТой потвърждава и прогнозата си, че до края на годината безработицата в САЩ ще се понижи до около 7%.\r\n\r\n...";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:6:"author";a:1:{i:0;a:5:{s:4:"data";s:5:"peter";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Thu, 11 Apr 2013 05:26:40 +0100";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:300:"http://prognometer.com/прогнози/безработица-и-заетост/2404-до-края-на-2013-г-безработицата-в-сащ-ще-се-понижи-до-около-7-прогнозира-президентът-на-фед-в-сейнт-луис-джеймс-булард.html";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:13;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:1:{s:0:"";a:6:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:95:"Имa голяма вероятност цената на тока да се увеличи ...";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:391:"http://prognometer.com/прогнози/енергия/електроенергия/2403-имa-голяма-вероятност-цената-на-тока-да-се-увеличи-от-01-07-2013-г-смята-председателят-на-държавната-комисия-по-енергийно-и-водно-регулиране-(дкевр)-евгения-харитонова.html";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:2263:"...\r\n\r\nИмa голяма вероятност цената на тока да се увеличи от 1 юли. За това подсказа председателят на Държавната комисия по енергийно и водно регулиране (ДКЕВР) Евгения Харитонова пред NovaTV. \r\n\r\n"Отчитайки и че миньорите искат едно чувствително повишаване на цената на въглищата от комплекса "Мини Марица Изток", това ще рефлектира и върху цената на въглищата и от другите мини. А пък въглищата в термичните централи участват някъде със 75-80% от основната цена", заяви Харитонова, като загатна за евентуалното повишение на цената на тока.\r\n\r\n"Не знам, разбира се, Министерството на икономиката, енергетиката и туризма какви цени ще одобри. Това трябва да определи министърът, защото въглищата не са регулирана стока в България", уточни още председателят на ДКЕВР. \r\n\r\nТя посочи, че всички енергийни дружества искат увеличение на цените, но това не значи, че това ще бъде одобрено. "Трябва да се разгледат всичките им разоди и да се види ДКЕВР какво ще признае и какво не. Комисията по принцип не признава всички разходи", посочи още Харитонова.\r\n\r\nРъководителят на регулатора отказа да прогнозира с колко може да се промени цената от 1 юли. Тя отказа да потвърди дали скокът в цената би бил рязък, като заяви, че на този етап "това не може да бъде коментирано".\r\n\r\n...";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:6:"author";a:1:{i:0;a:5:{s:4:"data";s:5:"peter";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Thu, 11 Apr 2013 05:26:38 +0100";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:391:"http://prognometer.com/прогнози/енергия/електроенергия/2403-имa-голяма-вероятност-цената-на-тока-да-се-увеличи-от-01-07-2013-г-смята-председателят-на-държавната-комисия-по-енергийно-и-водно-регулиране-(дкевр)-евгения-харитонова.html";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:14;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:1:{s:0:"";a:6:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:92:"Deutsche Bank намали прогнозата си за средната цена на ...";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:251:"http://prognometer.com/прогнози/метали/сребро/2391-deutsche-bank-намали-прогнозата-си-за-средната-цена-на-среброто-през-2013-г-с-16-5-до-31-долара-за-тройунция.html";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:369:"...\r\n\r\nDeutsche Bank понижи предвижданията си и за цената на среброто през настоящата и следващата година. За 2013 г. прогнозата е намалена с 16,5% до 31 долара за тройунция, а за 2014 г. - с 10,1% до 34 долара за тройунция.\r\n\r\n...";s:7:"attribs";a:0:{}