2:28 +0100";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:449:"http://prognometer.com/прогнози/индустриални-сектори/недвижими-имоти/ваканционни-имоти/2400-в-дългосрочен-план-българия-ще-продължава-да-привлича-чуждестранни-купувачи-на-ваканционни-имоти-очаква-управляващият-съдружник-на-new-estate-consultancy-горян-върбанов.html";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:24;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:1:{s:0:"";a:6:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:97:"Гръцкият брутен вътрешен продукт ще отчете спад от ...";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:354:"http://prognometer.com/прогнози/макроикономика/бвп/2401-гръцкият-брутен-вътрешен-продукт-ще-отчете-спад-от-5-през-2013-г-се-посочва-в-доклад-на-гръцката-фондация-за-икономически-и-индустриални-изследвания.html";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1228:"...\r\n\r\nТемпото на спад на гръцкия брутен вътрешен продукт ще се забави през 2013 г., но ще достигне 5%, се посочва в публикуван днес доклад на гръцката Фондация за икономически и индустриални изследвания (Ίδρυμα Οικονομικών και Βιομηχανικών Ερευνών – ΙΟΒΕ), цитиран от РИА Новости.\r\n\r\nПрез 2012 г. гръцката икономика се сви със 7,1%. През януари от фондацията оценяваха спада на БВП през 2013 г. на не повече от 4,6%, но предупредиха, че новите мерки на строги икономии, които ще започнат да се осъществяват през периода, могат да окажат негативно влияние върху динамиката на икономическия растеж. Друг съпътстващ фактор е свиването на потреблението, което през годината ще достигне до 9%.\r\n\r\n...";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:6:"author";a:1:{i:0;a:5:{s:4:"data";s:5:"peter";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Wed, 10 Apr 2013 08:12:28 +0100";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:354:"http://prognometer.com/прогнози/макроикономика/бвп/2401-гръцкият-брутен-вътрешен-продукт-ще-отчете-спад-от-5-през-2013-г-се-посочва-в-доклад-на-гръцката-фондация-за-икономически-и-индустриални-изследвания.html";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:25;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:1:{s:0:"";a:6:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:99:"През 2013 г. безработицата в Гърция почти ще спре да се ...";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:396:"http://prognometer.com/прогнози/безработица-и-заетост/2402-през-2013-г-безработицата-в-гърция-почти-ще-спре-да-се-увеличава-като-ще-остане-на-ниво-от-27-прогнозират-от-гръцката-фондация-за-икономически-и-индустриални-изследвания.html";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1026:"...\r\n\r\nПри това от IOBE прогнозират, че безработицата почти ще спре да се увеличава, но нивото ѝ от 27% ще остане най-високото в еврозоната. В доклада се подчертава, че само през 2012 г. в страната с население 11 млн. души 270 000 са загубили работата си.\r\n\r\nГърция реализира мерките на строги икономии, за да продължи да получава спасителната финансова помощ от международните си кредитори от европейския съюз и Международния валутен фонд.\r\n\r\nПонижаването на държавните разходи обаче задълбочи рецесията, в която страната изпадна през 2008 г. и от която не успява да се измъкне. \r\n\r\n...";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:6:"author";a:1:{i:0;a:5:{s:4:"data";s:5:"peter";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Wed, 10 Apr 2013 08:12:28 +0100";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:396:"http://prognometer.com/прогнози/безработица-и-заетост/2402-през-2013-г-безработицата-в-гърция-почти-ще-спре-да-се-увеличава-като-ще-остане-на-ниво-от-27-прогнозират-от-гръцката-фондация-за-икономически-и-индустриални-изследвания.html";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:26;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:1:{s:0:"";a:6:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:92:"Американският фондов пазар е свръхизкупен и ако ...";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:326:"http://prognometer.com/прогнози/акции/2388-американският-фондов-пазар-е-свръхизкупен-и-ако-добави-нови-печалби-в-краткосрочен-план-това-вещае-сериозни-неприятности-прогнозира-марк-фабер.html";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1893:"...\r\n\r\nВ краткосрочен план американският фондов пазар е свръхизкупен и ако добави нови печалби в краткосрочен план, това вещае сериозни неприятности, заяви издателят на Gloom, Boom & Doom Report Марк Фабер пред CNBC.\r\n\r\n“Ако продължим да се движим нагоре, вероятността от срив става все по-висока“, предрича Фабер. По думите му това може да се случи „някъде през втората половина на годината“.\r\n\r\nСпоред неговите изчисления „бичият“ пазар е започнал пред 4 години, но напоследък акците на важни компании като Oracle и FedEx са регистрирали отстъпление.\r\n\r\n„Можем ли да вървим нагоре само благодарение на акциите на няколко компании като Johnson & Johnson, Procter & Gamble, Wal-Mart и прочее?“, попита риторично Фабер и сам си отговори: „Вероятно“. „Бихме могли да стигнем нов връх при Standars & Poor\'s 500, но при много малко акции, достигнали нови висоти“, подчертава той.\r\n\r\nИнвеститорът предупреждава, че сега не е много добър момент за покупки на акции, тъй като смята, че те не са в началото на „бичия“ пазар, както предсказаха мнозина анализатори през последните няколко седмици.\r\n\r\n...";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:6:"author";a:1:{i:0;a:5:{s:4:"data";s:5:"peter";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Wed, 10 Apr 2013 06:03:40 +0100";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:326:"http://prognometer.com/прогнози/акции/2388-американският-фондов-пазар-е-свръхизкупен-и-ако-добави-нови-печалби-в-краткосрочен-план-това-вещае-сериозни-неприятности-прогнозира-марк-фабер.html";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:27;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:1:{s:0:"";a:6:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:92:"Deutsche Bank намали прогнозата си за средната цена на ...";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:242:"http://prognometer.com/прогнози/