:"http://prognometer.com/прогнози/метали/злато/2389-deutsche-bank-намали-прогнозата-си-за-средната-цена-на-златото-през-2013-г-с-11-8-до-1-637-долара-за-тройунция.html";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:993:"...\r\n\r\nГерманската банка Deutsche Bank понижи прогнозата си за цената на златото през тази и следващата година, позовавайки се на засилването на неблагоприятни фактори като поскъпването на долара, ускоряването на растежа в САЩ и нарастващия апетит на инвеститорите към акциите за сметка на суровините, съобщи MarketWatch.\r\n\r\nБанката оряза прогнозата си за средната цена на златото през 2013 г. с 11,8% до 1 637 долара за тройунция, а за 2014 г. - с 4,7% до 1 810 долара за тройунция.\r\n\r\nВ спотовата търговия в Европа днес златото се разменя при около 1 574 долара за тройунция.\r\n\r\n...";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:6:"author";a:1:{i:0;a:5:{s:4:"data";s:5:"peter";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Wed, 10 Apr 2013 06:03:32 +0100";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:250:"http://prognometer.com/прогнози/метали/злато/2389-deutsche-bank-намали-прогнозата-си-за-средната-цена-на-златото-през-2013-г-с-11-8-до-1-637-долара-за-тройунция.html";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:29;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:1:{s:0:"";a:6:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:96:"Ще станем свидетели на невиждан бичи пазар, когато ...";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:287:"http://prognometer.com/прогнози/акции/2387-ще-станем-свидетели-на-невиждан-бичи-пазар-когато-инвеститорите-осъзнаят-че-не-трябва-да-държат-кеш-прогнозира-марк-мобиус.html";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:2347:"...\r\n\r\n „Не можете да избягате от инерцията“ и това е основната причина, поради която инвеститорите държат облигации и кеш вместо акции, коментира изпълнителният директор на Templeton Emerging Markets Group в интервю за CNBC.\r\n\r\nНеотдавна, докато преглеждал своя собствен инвестиционен портфейл, (за който той никога нямал достатъчно време, тъй като бил зает да управлява чужди пари,) Мобиус осъзнал - „Една трета от активите ми са в кеш. Какво си мисля, че правя?“ Като много други инвеститори той си задал този въпрос и заключил: „Време е да купя повече акции.“\r\n\r\n„Това е инерцията, за която говорим, но аз мисля, че нещата са на път да се променят“, коментира инвеститорът, допълвайки че тогава се обадил на своя банкер и му поръчал да купи още акции, „защото е лудост човек да държи толкова много кеш“.\r\n\r\nМобиус изтъква, че това, което е преживял със своето собствено портфолио е показателно за една по-широка тенденция на „пробуждане“ сред инвеститорите, че акциите са единственият начин, по който те могат да получат истинска възвращаемост за парите си.\r\n\r\n„Отнема време“, допълва Мобиус. „Инвеститорите не са много пъргави. След като веднъж се усетят обаче, ще станем свидетели на невиждан бичи пазар. Всъщност вече наблюдаваме един много сериозен бичи пазар в САЩ. Това според мен е само началото“.\r\n\r\n...";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:6:"author";a:1:{i:0;a:5:{s:4:"data";s:5:"peter";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Tue, 09 Apr 2013 07:34:59 +0100";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:287:"http://prognometer.com/прогнози/акции/2387-ще-станем-свидетели-на-невиждан-бичи-пазар-когато-инвеститорите-осъзнаят-че-не-трябва-да-държат-кеш-прогнозира-марк-мобиус.html";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:30;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:1:{s:0:"";a:6:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:87:"Европейските акции са с по-добър потенциал за ...";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:336:"http://prognometer.com/прогнози/акции/2386-европейските-акции-са-с-по-добър-потенциал-за-възвращаемост-спрямо-щатските-в-дългосрочна-перспектива-прогнозират-от-австрийската-raiffeisen-bank-international-ag.html";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:2343:"...\r\n\r\nЕвропейските акции с по-добър потенциал за възвращаемост в дългосрочна перспектива\r\n\r\nАко се погледне индекса S&P 500, може да се забележи, че фазите на растеж, при които е регистриран нов връх, исторически продължават средно малко по-малко от 5 години, като стойностите се повишават средно със забележителните 155%. Настоящата тенденция на растеж започна приблизително точно преди 4 години и бе постигнат ръст от около 130%.\r\n\r\nТези наблюдения потвърждават, че американският пазар на акции достигна началото на зрялата си фаза. Европейският пазар на ценни книжа бе свидетел на смесени развития, главно поради спадовете на корпоративните резултати в периферните страни и голямата тежест на финансовия сектор. “На фона на постоянно добрите финансови условия и застоя на трудовия пазар, тенденцията за растеж на приходите не се очаква да приключи в близко бъдеще”, коментира Хелге Рехбергер, който оглавява звеното за анализ на капиталовите пазари. “Настоящите относително високи маржове в САЩ предполагат значително по-нисък от средното ръст на приходите в дългосрочен план. В Европа, очакванията в това отношение са по-добри, имайки предвид по-ниските стартови нива и потенциала за икономическо възстановяване “.\r\n\r\n...\r\n\r\nВижте пълната прогноза тук: \r\nhttp://www.rcm.at/cs/rcm/DokumentDownload/WMA_AT_en_aktuell.pdf";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:6:"author";a:1:{i:0;a:5:{s:4:"data";s:5:"peter";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Mon, 08 Apr 2013 06:37:32 +0100";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:336:"http://prognometer.com/прогнози/акции/2386-европейските-акции-са-с-по-добър-потенциал-за-възвращаемост-спрямо-щатските-в-дългосрочна-перспектива-прогнозират-от-австрийската-raiffeisen-bank-international-ag.html";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:31;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:1:{s:0:"";a:6:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:99:"Бързото сформиране на жизнеспособно правителство в ...";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:457:"http://prognometer.com/прогнози/валути/2385-бързото-сформиране-на-жизнеспособно-правителство-в-италия-ще-доведе-до-ново-намаляване-на-риска-на-пазарите-което-вероятно-ще-доведе-до-поскъпване-на-еврото-до-курс-eur-usd-1-35-очакват-от-австрийската-raiffeisen-bank-international-ag.html";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1374:"...\r\n\r\nРискови фактори остават формиране на правителство в Италия, бъдещето на бизнес модела в Кипър и съпротивата за напредък на реформите във Франция. \r\n\r\nПо отношение на валутния пазар анализаторите коментират, че от началото на годината движенията в двойката евро/долар бяха предопределени от дълговата криза в страните от Еврозоната.\r\n\r\n„Бързото сформиране на жизнеспособно правителство ще доведе до ново намаляване на риска на пазарите. В резултат на това рисковият диференциал би трябвало отново да се стесни. В такъв случай еврото бързо би се покачило до нива от 1.35 спрямо долара. Остава рискът обаче, да не бъде постигнато споразумение за жизнеспособно правителство в Италия”, сочи анализът на Райфайзен Рисърч за второто тримесечие на 2013 г.\r\n\r\n...";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:6:"author";a:1:{i:0;a:5:{s:4:"data";s:5:"peter";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Mon, 08 Apr 2013 06:37:29 +0100";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:457:"http://prognometer.com/прогнози/валути/2385-бързото-сформиране-на-жизнеспособно-правителство-в-италия-ще-доведе-до-ново-намаляване-на-риска-на-пазарите-което-вероятно-ще-доведе-до-поскъпване-на-еврото-до-курс-eur-usd-1-35-очакват-от-австрийската-raiffeisen-bank-international-ag.html";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:32;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:1:{s:0:"";a:6:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:100:"Ръст от 1.5% на брутния вътрешен продукт на САЩ за 2013 г. ...";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:258:"http://prognometer.com/прогнози/макроикономика/бвп/2384-ръст-от-1-5-на-брутния-вътрешен-продукт-на-сащ-за-2013-г-очакват-от-австрийската-raiffeisen-bank-international-ag.html";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:2736:"...\r\n\r\nАнализаторите на австрийската Raiffeisen Bank International AG се надяват на икономическо възстановяване през втората половина на тази година: „Икономическата активност в Европа и САЩ остава слаба. Въпреки че водещите индикатори като индексите ISM и ifo  продължават да показват подобряващ се сентимент сред компаниите, възстановяването трябва да бъде потвърдено и от солидни факти като нови поръчки”, коментира Петер Брециншек, директор на Raiffeisen Research. Все пак той изразява увереност, че още преди първото полугодие нетният износ би трябвало да даде първите знаци за икономически растеж и значително да стимулира инвестициите.\r\n\r\nСтабилният трудов пазар и доброто развитие по отношение на доходите за работещите в страните от ядрото на Еврозоната около Германия представляват допълнителен аргумент за възходяща тенденция при индивидуалното потребление.\r\n\r\n“Спадът на инфлацията през 2013 г. ще благоприятства увеличението на реалните доходи. Все пак, ефектът от доходите се очаква да започне да оказва влияние от 2014 г. На пръв поглед, прогнозата за БВП на Еврозоната за тази година изглежда недобра, като очакванията са за спад от 0.1% поради по-предпазливите очаквания за първото полугодие. Като цяло, общата тенденция за идните 12-18 месеца е възходяща. Разликите в икономическата активност вътре в самата Еврозона се очаква да продължат сравнително дълго. Бюджетните ограничения в САЩ, които започнаха да се осъществяват през март, съответстват на очакванията на Raiffeisen Research за ръст на БВП от 1,5% през 2013 г.\r\n\r\n...";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:6:"author";a:1:{i:0;a:5:{s:4:"data";s:5:"peter";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Mon, 08 Apr 2013 06:37:25 +0100";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:258:"http://prognometer.com/прогнози/макроикономика/бвп/2384-ръст-от-1-5-на-брутния-вътрешен-продукт-на-сащ-за-2013-г-очакват-от-австрийската-raiffeisen-bank-international-ag.html";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:33;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:1:{s:0:"";a:6:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:79:"Спад от 0.1% на брутния вътрешен продукт на ...";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:272:"http://prognometer.com/прогнози/макроикономика/бвп/2383-спад-от-0-1-на-брутния-вътрешен-продукт-на-еврозоната-за-2013-г-очакват-от-австрийската-raiffeisen-bank-international-ag.html";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:2736:"...\r\n\r\nАнализаторите на австрийската Raiffeisen Bank International AG се надяват на икономическо възстановяване през втората половина на тази година: „Икономическата активност в Европа и САЩ остава слаба. Въпреки че водещите индикатори като индексите ISM и ifo  продължават да показват подобряващ се сентимент сред компаниите, възстановяването трябва да бъде потвърдено и от солидни факти като нови поръчки”, коментира Петер Брециншек, директор на Raiffeisen Research. Все пак той изразява увереност, че още преди първото полугодие нетният износ би трябвало да даде първите знаци за икономически растеж и значително да стимулира инвестициите.\r\n\r\nСтабилният трудов пазар и доброто развитие по отношение на доходите за работещите в страните от ядрото на Еврозоната около Германия представляват допълнителен аргумент за възходяща тенденция при индивидуалното потребление.\r\n\r\n“Спадът на инфлацията през 2013 г. ще благоприятства увеличението на реалните доходи. Все пак, ефектът от доходите се очаква да започне да оказва влияние от 2014 г. На пръв поглед, прогнозата за БВП на Еврозоната за тази година изглежда недобра, като очакванията са за спад от 0.1% поради по-предпазливите очаквания за първото полугодие. Като цяло, общата тенденция за идните 12-18 месеца е възходяща. Разликите в икономическата активност вътре в самата Еврозона се очаква да продължат сравнително дълго. Бюджетните ограничения в САЩ, които започнаха да се осъществяват през март, съответстват на очакванията на Raiffeisen Research за ръст на БВП от 1,5% през 2013 г.\r\n\r\n...";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:6:"author";a:1:{i:0;a:5:{s:4:"data";s:5:"peter";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Mon, 08 Apr 2013 06:37:23 +0100";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:272:"http://prognometer.com/прогнози/макроикономика/бвп/2383-спад-от-0-1-на-брутния-вътрешен-продукт-на-еврозоната-за-2013-г-очакват-от-австрийската-raiffeisen-bank-international-ag.html";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:34;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:1:{s:0:"";a:6:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:72:"През 2013 г. средната цена на жилище във ...";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:420:"http://prognometer.com/прогнози/индустриални-сектори/недвижими-имоти/жилищни-имоти/2382-през-2013-г-средната-цена-на-жилище-във-великобритания-ще-бъде-222-хил-паунда-равняващо-се-на-годишен-ръст-от-1-4-прогнозират-от-centre-for-economics-and-business-research-(cebr).html";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:2107:"...\r\n\r\nПрез следващата година средната цена на жилищата във Великобритания ще достигне 227 хил. паунда, като за първи път ще надхвърли нивата отпреди кризата, според нови прогнози, цитирани от онлайн изданието Property Community.\r\n\r\nОчакванията са средната цена на имотите да се повиши до 267 хил. паунда към 2018 г. През тази година средната цена вероятно ще се повиши с 1,4% спрямо миналата до 222 хил. паунда.\r\n\r\nАнализаторите от центъра за икономически и бизнес изследвания (CEBR) посочват, че правителствените стимули за жилищното строителство и сделките с имоти също съдействат за ръста на цените, но не водят до по-голямо предлагане на британския пазар, който страда от хроничен недостиг на жилища.\r\n\r\nОчаква се заради схемата за купувачите на първи дом през 2014 г. цените да се повишат с близо процент без съществен ръст на предлагането. Ответна реакция на строителите вероятно ще има една година по-късно – през 2015 г., посочват експертите.\r\n\r\nВсе пак ръстът на цените е ограничен заради по-слабото повишаване на доходите и финансовата несигурност. Ако икономиката обаче се засили, растежът на цените също ще се ускори на фона на прираста на населението и слабото предлагане.\r\n\r\n...";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:6:"author";a:1:{i:0;a:5:{s:4:"data"