а-цена-на-жилище-във-великобритания-ще-достигне-227-хил-паунда-като-за-първи-път-ще-надхвърли-нивата-отпреди-кризата-прогнозират-от-centre-for-economics-and-business-research-(cebr).html";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:2107:"...\r\n\r\nПрез следващата година средната цена на жилищата във Великобритания ще достигне 227 хил. паунда, като за първи път ще надхвърли нивата отпреди кризата, според нови прогнози, цитирани от онлайн изданието Property Community.\r\n\r\nОчакванията са средната цена на имотите да се повиши до 267 хил. паунда към 2018 г. През тази година средната цена вероятно ще се повиши с 1,4% спрямо миналата до 222 хил. паунда.\r\n\r\nАнализаторите от центъра за икономически и бизнес изследвания (CEBR) посочват, че правителствените стимули за жилищното строителство и сделките с имоти също съдействат за ръста на цените, но не водят до по-голямо предлагане на британския пазар, който страда от хроничен недостиг на жилища.\r\n\r\nОчаква се заради схемата за купувачите на първи дом през 2014 г. цените да се повишат с близо процент без съществен ръст на предлагането. Ответна реакция на строителите вероятно ще има една година по-късно – през 2015 г., посочват експертите.\r\n\r\nВсе пак ръстът на цените е ограничен заради по-слабото повишаване на доходите и финансовата несигурност. Ако икономиката обаче се засили, растежът на цените също ще се ускори на фона на прираста на населението и слабото предлагане.\r\n\r\n...";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:6:"author";a:1:{i:0;a:5:{s:4:"data";s:5:"peter";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Mon, 08 Apr 2013 06:37:16 +0100";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:465:"http://prognometer.com/прогнози/индустриални-сектори/недвижими-имоти/жилищни-имоти/2380-през-2014-г-средната-цена-на-жилище-във-великобритания-ще-достигне-227-хил-паунда-като-за-първи-път-ще-надхвърли-нивата-отпреди-кризата-прогнозират-от-centre-for-economics-and-business-research-(cebr).html";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:37;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:1:{s:0:"";a:6:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:98:"Пазарът на екзоскелети за медицинска употреба може ...";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:332:"http://prognometer.com/прогнози/наука-и-техника/2379-пазарът-на-екзоскелети-за-медицинска-употреба-може-да-нарасне-до-400-млн-долара-към-2020-г-очакват-от-компанията-за-пазарни-проучвания-abi-research.html";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:2315:"...\r\n\r\nПрез 60-те години Невероятният Хълк се прочу със своята супер сила като непобедимия анти-герой от Marvel Comics. Сега Lockheed Martin залага, че съвременен вариант на Хълк ще помогне на компанията да реализира огромни продажби в близко бъдеще, пише Bloomberg Businessweek.\r\n\r\nВизията на Lockheed, най-голямата отбранителна компания в света, е за технологичен скок в мобилността на бойното поле с Human Universal Load Carrier (HULC). Веднъж облечен, екзоскелетът ще позволява на войниците да пренасят до 90 кг. на разстояние 20 км. с минимално усилие.\r\n\r\nТова би било забележително постижение, тъй като проблемите с гръбначния стълб са най-често срещаните травми в армията извън реалните бойни мисии.\r\n\r\nЕкзоскелетите имат „огромен потенциал“, казва Дейвид Асета, говорител на американския армейски център за военни разработки, проучвания и инженеринг.\r\n\r\n...\r\n\r\n...\r\n\r\nПървата продажба на медицински екзоскелет за лична употреба, (вместо на болница или рехабилитационен център), беше извършена през септември 2012 г. от Argo Medical Technologies, чието устройство ReWalk помага на хора, които не могат да използват краката си.\r\n\r\nОттогава компанията е продала около 20 устройства на клиенти в Европа. Така Argo се превръща в пионер на пазара на екзоскелети за медицинска употреба, който според ABI Research до 2020 г. може да нарасне до 400 млн. долара.\r\n\r\n...";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:6:"author";a:1:{i:0;a:5:{s:4:"data";s:5:"peter";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Mon, 08 Apr 2013 06:37:13 +0100";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:332:"http://prognometer.com/прогнози/наука-и-техника/2379-пазарът-на-екзоскелети-за-медицинска-употреба-може-да-нарасне-до-400-млн-долара-към-2020-г-очакват-от-компанията-за-пазарни-проучвания-abi-research.html";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:38;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:1:{s:0:"";a:6:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:85:"Цените на недвижимите имоти в България ще се ...";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:458:"http://prognometer.com/прогнози/индустриални-сектори/недвижими-имоти/жилищни-имоти/2376-цените-на-недвижимите-имоти-в-българия-ще-се-понижават-докато-достигнат-нива-съизмерими-с-покупателните-възможности-на-купувачите-смята-управителят-на-агенция-„евина”.html";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:4832:"...\r\n\r\nИма ли нужда от регулация на пазара на имоти, как трябва да е организиран контролът и колко строг да бъде – разговаряме с управителя на агенцията за имоти “Евина” Кристина Найденова.\r\n\r\nГ-жа Найденова е машинен инженер и оценител, има допълнителни квалификации в сферата на финансовия мениджмънт. През 2008 г. основава агенцията за имоти “Евина”, която управлява до днес.\r\n\r\n...\r\n\r\n...\r\n\r\n- Нека поговорим малко за пазара на имоти. Ваши колеги отчитат, че има някакво оживление, естествено не това, което се случваше допреди няколко години. Вие какви наблюдения имате?\r\n\r\nНаблюденията ми за оживление на пазара на имоти са доста разнопосочни, поне ако изхождам от разговорите с колеги. Това е свързано с цените, на които се предлагат имотите и цените, на които се извършват продажби. Общоизвестен факт е, че се сключват сделки на цени, които се различават с 30-50% от офертните цени, т.е. имотите са надценени и цените им не са съобразени с възможностите на купувачите.\r\n\r\nИма икономически показатели, които подкрепят това твърдение. Цената на един имот е наемът, който може да се получи от него за 10 години. Ако един имот в среден квартал със средно качество се отдава под наем за 400лв. на месец, то цената му е 48 000лв. (400лв./месец х 120 месеца).\r\n\r\nЦената на един имот е доходът на едно домакинството за 3 години. Средната работна заплата у нас е около 700 лева. Това означава, че един работещ човек би трябвало да може да си купи гарсониера със средно качество в среден квартал за 25 200лв. (700лв. месечна заплата х 36 месеца).\r\n\r\nКакто виждаме от обявите за продажби, имоти от примерите се предлагат на пазара от 2 до 3 пъти по-скъпо.\r\n\r\n- Каква корекция виждате?\r\n\r\nПоевтиняване около два - до три пъти. Сега продажби стават случайно. Продават или хора, които са притеснени финансово и нямат избор по различни причини, или хора, които са разумни. Икономистите казват: „парите днес са по-скъпи от парите утре”, т.е. по-добре е да имаш пари днес, да работиш с тях и те да носят доход, отколкото продавачът да очаква да получи неизвестна сума пари в необозримо бъдеще. \r\n\r\nОчертава се икономическата криза да продължи 10 и повече години. Отлагането на продажба на имот за едно бъдещо време не е в полза на продавача.\r\n\r\n- Ако се запази сегашното темпо на спад на цените, което отчитат и от статистическия институт, и агенциите на базата на тяхната си статистика, колко време ще продължи тази корекция? Може ли да се очаква някакъв период от време, в който отново да има рязко пропадане?\r\n\r\nЦените на имотите ще се понижават, докато стигнат нива, съизмерими с покупателните възможности на купувачите. Не очаквам обаче рязка промяна в цените на имотите, нито в посока поевтиняване, нито в посока поскъпване.\r\n\r\n...";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:6:"author";a:1:{i:0;a:5:{s:4:"data";s:5:"peter";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Fri, 05 Apr 2013 06:14:55 +0100";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:458:"http://prognometer.com/прогнози/индустриални-сектори/недвижими-имоти/жилищни-имоти/2376-цените-на-недвижимите-имоти-в-българия-ще-се-понижават-докато-достигнат-нива-съизмерими-с-покупателните-възможности-на-купувачите-смята-управителят-на-агенция-„евина”.html";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}}}}i:39;a:6:{s:4:"data";s:13:"\n	\n	\n	\n	\n	\n	\n";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";s:5:"child";a:1:{s:0:"";a:6:{s:5:"title";a:1:{i:0;a:5:{s:4:"data";s:87:"Април 2013 г.: Японската централна банка (ЯЦБ) си ...";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"link";a:1:{i:0;a:5:{s:4:"data";s:406:"http://prognometer.com/прогнози/инфлация/2378-април-2013-г-японската-централна-банка-(яцб)-си-поставя-за-цел-да-повиши-инфлацията-в-страната-до-2-през-следващите-2-години-чрез-интензивна-програма-за-увеличаване-на-паричното-предлагане.html";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:11:"description";a:1:{i:0;a:5:{s:4:"data";s:1518:"...\r\n\r\nЯпонската централна банка (ЯЦБ) увеличава драстично паричното предлагане, за да стимулира растежа, съобщава BBC.\r\n\r\nЦентралната банка в Токио обеща да интензифицира програмата си за изкупуване на облигации и да повиши инфлацията в страната до 2% през следващите 2 години. Решението бе взето след двудневна среща – първата, ръководена от новоизбрания управител на банката Харухико Курода.\r\n\r\nЯпонската икономика се бори с дефлацията от десетилетия.\r\n\r\nКурода не веднъж е заявявал, че ще направи „каквото е необходимо“, за да подкрепи растежа. „ЯЦБ ще извършва операции на паричните пазари, така че паричната база в страната да се увеличава с годишен темп от около 60 трлн. до 70 трлн. йени (645 млрд. до 755 млрд. долара)“, се посочва в изявление на институцията.\r\n\r\nУвеличаването на паричното предлагане се очаква да предизвика инфлация.\r\n\r\n...";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:6:"author";a:1:{i:0;a:5:{s:4:"data";s:5:"peter";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:7:"pubDate";a:1:{i:0;a:5:{s:4:"data";s:31:"Fri, 05 Apr 2013 06:14:49 +0100";s:7:"attribs";a:0:{}s:8:"xml_base";s:0:"";s:17:"xml_base_explicit";b:0;s:8:"xml_lang";s:0:"";}}s:4:"guid";a:1:{i:0;a:5:{s:4:"data";s:406:"http://prognometer.com/прогнози/инфлация/2378-април-2013-г-японската-централна-банка-(яцб)-си-поставя-за-цел-да-повиши-инфлаци