	(1, 1, '2013-03-08 07:55:10', '2013-03-08 07:55:10', '<h4><strong>Добре дошли във виртуалния склад!</strong></h4>\r\nОт тук вие ще можете да избирате и оформяте вашите заявки за необходимия ви метал. След избора на вида и количествата желана металопродукция, ние ще се свържем с вас за предоставяне на оферта.\r\n\r\n&nbsp;\r\n<h3><strong>Приятно пазаруване!</strong></h3>', 'Добре дошли във виртуалния склад на Мечел', '', 'publish', 'closed', 'closed', '', 'hello-world', '', '', '2013-03-08 16:03:08', '2013-03-08 16:03:08', '', 0, 'http://metal-sales.tk/?p=1', 0, 'post', '', 0),
	(2, 1, '2013-03-08 07:55:10', '2013-03-08 07:55:10', '<p style="text-align: justify;"><span style="color: #000000;"><b><span style="font-family: Verdana; font-size: medium;">        Мечел Сървис България ЕООД</span></b><span style="font-family: Verdana;font-size: medium;"> е компания с предмет на дейност внос и търговия на черни метали и металопродукция. Фирмата осъществява дейността си на територията на цялата страна, разполага със складови бази и търговски представителства в София, Русе и Бургас. </span></span></p>\r\n<p style="text-align: justify;"><span style="font-family: Verdana; color: #000000;font-size: medium;">        На българския пазар компанията доставя пълна гама от висококачествени стоманени продукти, отговарящи изцяло на международните стандарти и предлага на своите партньори атрактивни цени, гъвкави условия на плащане и доставка, както и размери и количества по спецификации на клиентите.</span></p>\r\n<p style="text-align: justify;"><span style="font-family: Verdana; color: #000000;font-size: medium;">    <b>       Мечел Сървис България ЕООД</b> е част от международната търговска компания Мечел Сървис Глобъл, която специализира дейността си в областта на продажбите, доставката и преработката на метални изделия. Като част от групата „Мечел” – една от водещите компании в областта на металургията и добивната промишленост, Мечел Сървис България е изключителен представител и доставчик за България на продукцията от всички металургични заводи на "Мечел".</span></p>', 'За нас', '', 'publish', 'closed', 'closed', '', '%d0%bf%d1%80%d0%b8%d0%bc%d0%b5%d1%80%d0%bd%d0%b0-%d1%81%d1%82%d1%80%d0%b0%d0%bd%d0%b8%d1%86%d0%b0', '', '', '2013-04-15 10:38:23', '2013-04-15 10:38:23', '', 0, 'http://metal-sales.tk/?page_id=2', 0, 'page', '', 0),
