	(175, 1, '2013-04-02 14:21:44', '2013-04-02 14:21:44', 'Lorem Ipsum е елементарен примерен текст, използван в печатарската и типографската индустрия. Lorem Ipsum е индустриален стандарт от около 1500 година, когато неизвестен печатар взема няколко печатарски букви и ги разбърква, за да напечата с тях книга с примерни шрифтове. Този начин не само е оцелял повече от 5 века, но е навлязъл и в публикуването на електронни издания като е запазен почти без промяна. Популяризиран е през 60те години на 20ти век със издаването на Letraset листи, съдържащи Lorem Ipsum пасажи, популярен е и в наши дни във софтуер за печатни издания като Aldus PageMaker, който включва различни версии на Lorem Ipsum\r\n\r\n<a href="http://metal-sales.tk/"><img class="aligncenter size-full wp-image-43" title="home11" alt="" src="http://metal-sales.tk/wp-content/uploads/2013/03/home113.jpg" width="800" height="600" /></a><span style="color: #444444;"> </span><span style="color: #00ccff;"><em>Съществуват много вариации на пасажа Lorem Ipsum, но повечето от тях са променени по един или друг начин чрез добавяне на смешни думи или разбъркване на думите, което не изглежда много достоверно. Ако искате да използвате пасаж от Lorem Ipsum, трябва да сте сигурни, че в него няма смущаващи или нецензурни думи. Всички Lorem Ipsum генератори в Интернет използват предефинирани пасажи, който се повтарят, което прави този този генератор първия истински такъв. Той използва речник от над 200 латински думи, комбинирани по подходящ начин като изречения, за да генерират истински Lorem Ipsum пасажи. Оттук следва, че генерираният Lorem Ipsum пасаж не съдържа повторения, смущаващи, нецензурни и всякакви неподходящи думи.</em></span>', 'За нас', '', 'inherit', 'closed', 'closed', '', '2-revision-17', '', '', '2013-04-02 14:21:44', '2013-04-02 14:21:44', '', 2, 'http://metal-sales.tk/?p=175', 0, 'revision', '', 0),
