	(12, 1, '2013-03-08 07:55:10', '2013-03-08 07:55:10', 'Това е примерна страница. Страниците се различават от публикациите по това, че стоят на едно място и в повечето теми се показват в основната навигация. Повечето хора започват със страница „За нас“, в която се представят пред посетителите на сайта. Тя може да съдържа нещо подобно на:\n\n<blockquote>Здравейте! През деня разнасям поща с колело, вечер играя в малък театър и това е моят блог. Живея в София, имам страхотно куче –  Джеси – и много обичам мента. (И да се разхождам в дъжда.)</blockquote>\n\n...или нещо като това:\n\n<blockquote>ХШЩ е фирма за джаджи, основана през 1993г. и от тогава произвежда качествени джаджи за всички. ХШЩ има 19 служители в с. Долно Камарци и прави редица страхотни неща за обществото в града.</blockquote>\n\nКато нов потребител на WordPress, отидете на <a href="http://metal-sales.tk/wp-admin/">таблото си</a>, където може да изтриете или редактирате тази страница и да създадете много нови. Забавлявай се!', 'Примерна страница', '', 'inherit', 'open', 'open', '', '2-revision', '', '', '2013-03-08 07:55:10', '2013-03-08 07:55:10', '', 2, 'http://metal-sales.tk/?p=12', 0, 'revision', '', 0),
