	(177, 1, '2013-04-04 11:25:28', '2013-04-04 11:25:28', '<b>Мечел Сървис България ЕООД</b> е част от международната търговска компания Мечел Сървис Глобъл, която специализира дейността си в областта на продажбите, доставката и преработката  на метални изделия. Като част от групата „Мечел” – една от водещите компании в областта на металургията и добивната промишленост, Мечел Сървис България е изключителен представител и доставчик за България на продукцията от всички металургични заводи на „Мечел”.\r\n\r\n&nbsp;\r\n<p align="left">На българския пазар компанията доставя пълна гама от висококачествени стоманени продукти, отговарящи изцяло на международните стандарти, и предлага на своите партньори атрактивни цени, гъвкави условия за плащате и доставка, както и размери и количества по спецификация на клиентите.</p>\r\n&nbsp;', 'За нас', '', 'inherit', 'closed', 'closed', '', '2-revision-19', '', '', '2013-04-04 11:25:28', '2013-04-04 11:25:28', '', 2, 'http://metal-sales.tk/?p=177', 0, 'revision', '', 0),
