	(247, 1, '2013-04-15 10:05:29', '2013-04-15 10:05:29', '<p align="center"><b><font face="Verdana" size="5" color="#0080C1">Добре дошли в \r\nсайта на МЕЧЕЛ СЪРВИС БЪЛГАРИЯ! </font></b></p>\r\n<p align="justify"><font face="Verdana" size="4">Тук можете да направите своето \r\nзапитване за налични продукти от продуктовата ни гама или да отправите въпроси, \r\nсвързани с&nbsp; изпълнение на заявки по Ваше задание. </font></p>\r\n<p align="justify"><font face="Verdana" size="4">Търговските мениджъри на Мечел \r\nСървис България ще обработят Вашето запитване и ще изпратят изготвената оферта \r\nвъв възможно най-кратък срок! </font></p>\r\n<p align="justify"><font face="Verdana" size="4">Това не е он-лайн магазин и тук \r\nплащания не се извършват!</font></p>\r\n', 'Начало', '', 'inherit', 'closed', 'closed', '', '211-revision-10', '', '', '2013-04-15 10:05:29', '2013-04-15 10:05:29', '', 211, 'http://metal-sales.tk/?p=247', 0, 'revision', '', 0),
	(259, 1, '2013-04-15 10:20:33', '2013-04-15 10:20:33', '<span style="color: #000000;"><b>           <span style="font-family: Verdana;">Мечел Сървис България ЕООД</span></b><span style="font-family: Verdana;"> е компания с предмет на дейност внос и търговия на черни метали и металопродукция. Фирмата осъществява дейността си на територията на цялата страна, разполага със складови бази и търговски представителства в София, Русе и Бургас.</span></span>\r\n\r\n<span style="font-family: Verdana; color: #000000;">\r\nНа българския пазар компанията доставя пълна гама от висококачествени стоманени продукти, отговарящи изцяло на международните стандарти и предлага на своите партньори атрактивни цени, гъвкави условия на плащане и доставка, както и\r\nразмери и количества по спецификации на клиентите.\r\n</span>\r\n\r\n<span style="font-family: Verdana; color: #000000;"><b>\r\nМечел Сървис България ЕООД</b> е част от международната търговска компания Мечел Сървис Глобъл", която специализира дейността си в областта на продажбите,\r\nдоставката и преработката  на метални изделия. Като част от групата "Мечел" – една от водещите компании в областта на металургията и добивната промишленост, "Мечел Сървис България" е изключителен представител и доставчик за България на продукцията от всички металургични заводи на "Мечел".</span>', 'За нас', '', 'inherit', 'closed', 'closed', '', '2-revision-24', '', '', '2013-04-15 10:20:33', '2013-04-15 10:20:33', '', 2, 'http://metal-sales.tk/?p=259', 0, 'revision', '', 0),
	(261, 1, '2013-04-15 10:26:23', '2013-04-15 10:26:23', '<b><span style="font-family: Verdana;">        Мечел Сървис България ЕООД</span></b><span style="font-family: Verdana;"> е компания с предмет на дейност внос и търговия на черни метали и металопродукция. Фирмата осъществява дейността си на територията на цялата страна, разполага със складови бази и търговски представителства в София, Русе и Бургас. </span>\r\n\r\n<span style="font-family: Verdana;">        На българския пазар компанията доставя пълна гама от висококачествени стоманени продукти, отговарящи изцяло на международните стандарти и предлага на своите партньори\r\nатрактивни цени, гъвкави условия на плащане и доставка, както и размери и количества по спецификации на клиентите.</span>\r\n\r\n<span style="font-family: Verdana;">    <b>    Мечел Сървис България ЕООД</b> е част от международната търговска компания Мечел Сървис Глобъл, която специализира дейността си в областта на продажбите, доставката и преработката на метални изделия. Като част от групата „Мечел” – една от водещите компании в областта на металургията и добивната промишленост, Мечел Сървис България е\r\nизключителен представител и доставчик за България на продукцията от всички металургични заводи на "Мечел".</span>', 'За нас', '', 'inherit', 'closed', 'closed', '', '2-revision-26', '', '', '2013-04-15 10:26:23', '2013-04-15 10:26:23', '', 2, 'http://metal-sales.tk/?p=261', 0, 'revision', '', 0),
	(260, 1, '2013-04-15 10:24:09', '2013-04-15 10:24:09', '<p><b>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n<font face="Verdana">Мечел Сървис България ЕООД</font></b><font face="Verdana">&nbsp;е \r\nкомпания с предмет на дейност внос и търговия на черни метали и металопродукция. \r\nФирмата осъществява дейността си на територията на цялата страна, разполага със \r\nскладови бази и търговски представителства в София, Русе и Бургас.</font></p>\r\n<p><font face="Verdana">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; На българския \r\nпазар компанията доставя пълна гама от висококачествени стоманени продукти, \r\nотговарящи изцяло на международните стандарти и предлага на своите партньори \r\nатрактивни цени, гъвкави условия на плащане и доставка, както и размери и \r\nколичества по спецификации на клиентите.</font></p>\r\n<p><font face="Verdana">&nbsp;&nbsp;&nbsp; <b>&nbsp;&nbsp;&nbsp; Мечел Сървис \r\nБългария ЕООД</b> е \r\nчаст от международната търговска компания Мечел Сървис Глобъл, която \r\nспециализира дейността си в областта на продажбите, доставката и преработката&nbsp; \r\nна метални изделия. Като част от групата „Мечел” – една от водещите компании в \r\nобластта на металургията и добивната промишленост, Мечел Сървис България е \r\nизключителен представител и доставчик за България на продукцията от всички \r\nметалургични заводи на &quot;Мечел&quot;.</font></p>\r\n', 'За нас', '', 'inherit', 'closed', 'closed', '', '2-revision-25', '', '', '2013-04-15 10:24:09', '2013-04-15 10:24:09', '', 2, 'http://metal-sales.tk/?p=260', 0, 'revision', '', 0),
