 на МЕЧЕЛ СЪРВИС БЪЛГАРИЯ!</span></p>\r\n<p class="MsoNormal" style="margin-top: 12.0pt; margin-right: 0cm; margin-bottom: 12.0pt; margin-left: 0cm; text-align: left; line-height: 18.0pt; background: #F8F8F8;" align="left"><span lang="BG" style="font-family: \'Arial\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: BG; mso-bidi-font-style: italic;">Тук можете да направите своето запитване за налични продукти от продуктовата ни гама или да отправите въпроси, свързани с<span style="mso-spacerun: yes;">  </span>изпълнение на заявки по Ваше задание. </span></p>\r\n<p class="MsoNormal" style="margin-top: 12.0pt; margin-right: 0cm; margin-bottom: 12.0pt; margin-left: 0cm; text-align: left; line-height: 18.0pt; background: #F8F8F8;" align="left"><span lang="BG" style="font-family: \'Arial\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: BG; mso-bidi-font-style: italic;">Търговските мениджъри на Мечел Сървис България ще обработят Вашето запитване и ще изпратят изготвената оферта във възможно най-кратък срок!</span></p>\r\n<p class="MsoNormal" style="margin-top: 12.0pt; margin-right: 0cm; margin-bottom: 12.0pt; margin-left: 0cm; text-align: left; line-height: 18.0pt; background: #F8F8F8;" align="left"><span lang="BG" style="font-family: \'Arial\',\'sans-serif\'; mso-fareast-font-family: \'Times New Roman\'; mso-fareast-language: BG; mso-bidi-font-style: italic;">Това не е он-лайн магазин и тук плащания не се извършват!</span></p>', 'Начало', '', 'inherit', 'closed', 'closed', '', '211-revision-3', '', '', '2013-04-15 09:48:27', '2013-04-15 09:48:27', '', 211, 'http://metal-sales.tk/?p=240', 0, 'revision', '', 0),
