	(256, 1, '2013-04-05 12:28:13', '2013-04-05 12:28:13', '<b>Мечел Сървис България ЕООД</b> е част от международната търговска компания Мечел Сървис Глобъл, която специализира дейността си в областта на продажбите, доставката и преработката  на метални изделия. Като част от групата „Мечел” – една от водещите компании в областта на металургията и добивната промишленост, Мечел Сървис България е изключителен представител и доставчик за България на продукцията от всички металургични заводи на „Мечел”.\r\n\r\nНа българския пазар компанията доставя пълна гама от висококачествени стоманени продукти, отговарящи изцяло на международните стандарти, и предлага на своите партньори атрактивни цени, гъвкави условия за плащате и доставка, както и размери и количества по спецификация на клиентите.\r\n\r\n&nbsp;', 'За нас', '', 'inherit', 'closed', 'closed', '', '2-revision-21', '', '', '2013-04-05 12:28:13', '2013-04-05 12:28:13', '', 2, 'http://metal-sales.tk/?p=256', 0, 'revision', '', 0),
	(258, 1, '2013-04-15 10:20:02', '2013-04-15 10:20:02', '<span style="color: #000000;"><b>           <span style="font-family: Verdana;">Мечел Сървис България ЕООД</span></b><span style="font-family: Verdana;"> е компания с предмет на дейност внос и търговия на черни метали и металопродукция.\r\nФирмата осъществява дейността си на територията на цялата страна, разполага със складови бази и търговски представителства в София, Русе и Бургас.</span></span>\r\n\r\n<span style="font-family: Verdana; color: #000000;">\r\nНа българския пазар компанията доставя пълна гама от висококачествени стоманени продукти, отговарящи изцяло на международните стандарти и предлага на своите партньори атрактивни цени, гъвкави условия на плащане и доставка, както и\r\nразмери и количества по спецификации на клиентите.\r\n</span>\r\n\r\n<span style="font-family: Verdana; color: #000000;"><b>\r\nМечел Сървис България ЕООД</b> е част от международната търговска компания Мечел Сървис Глобъл", която специализира дейността си в областта на продажбите,\r\nдоставката и преработката  на метални изделия. Като част от групата "Мечел" – една от водещите компании в областта на металургията и добивната промишленост, "Мечел Сървис България" е изключителен представител и доставчик за България на продукцията от всички металургични заводи на "Мечел".</span>', 'За нас', '', 'inherit', 'closed', 'closed', '', '2-revision-23', '', '', '2013-04-15 10:20:02', '2013-04-15 10:20:02', '', 2, 'http://metal-sales.tk/?p=258', 0, 'revision', '', 0),
	(257, 1, '2013-04-15 10:17:40', '2013-04-15 10:17:40', '<p><b>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;\r\n<font face="Verdana">Мечел Сървис България ЕООД</font></b><font face="Verdana">&nbsp;е \r\nкомпания с предмет на дейност внос и търговия на черни метали и металопродукция. \r\nФирмата осъществява дейността си на територията на цялата страна, разполага със \r\nскладови бази и търговски представителства в София, Русе и Бургас.</font></p>\r\n<p><font face="Verdana">&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; \r\nНа българския пазар компанията доставя пълна гама от висококачествени стоманени \r\nпродукти, отговарящи изцяло на международните стандарти и предлага на своите \r\nпартньори атрактивни цени, гъвкави условия на плащане и доставка, както и \r\nразмери и количества по спецификации на клиентите.</font></p>\r\n<p><font face="Verdana"><b>&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp;&nbsp; \r\nМечел Сървис България ЕООД</b> е част от международната търговска компания Мечел \r\nСървис Глобъл, която специализира дейността си в областта на продажбите, \r\nдоставката и преработката&nbsp; на метални изделия. Като част от групата „Мечел” – \r\nедна от водещите компании в областта на металургията и добивната промишленост, \r\nМечел Сървис България е изключителен представител и доставчик за България на \r\nпродукцията от всички металургични заводи на „Мечел”.</font></p>\r\n', 'За нас', '', 'inherit', 'closed', 'closed', '', '2-revision-22', '', '', '2013-04-15 10:17:40', '2013-04-15 10:17:40', '', 2, 'http://metal-sales.tk/?p=257', 0, 'revision', '', 0),
