	(246, 1, '2013-04-15 10:02:58', '2013-04-15 10:02:58', '<p class="MsoNormal" align="left" style="text-align: center; line-height: 18.0pt; margin: 12.0pt 0cm; background: #F8F8F8">\r\n<span lang="BG" style="font-family: Tahoma; font-weight: 700; font-style: italic; background-color: #FFFFFF">\r\n<font size="5" color="#0080C1">Добре дошли в сайта на МЕЧЕЛ СЪРВИС БЪЛГАРИЯ!</font></span></p>\r\n<p class="MsoNormal" align="left" style="line-height: 18.0pt; margin: 12.0pt 0cm; background: #F8F8F8">\r\n<span lang="BG" style="font-family: Arial,sans-serif; background-color: #FFFFFF">\r\n<font size="4">Тук можете да направите своето запитване за налични продукти от \r\nпродуктовата ни гама или да отправите въпроси, свързани с&nbsp; изпълнение на заявки \r\nпо Ваше задание. </font></span></p>\r\n<p class="MsoNormal" align="left" style="line-height: 18.0pt; margin: 12.0pt 0cm; background: #F8F8F8">\r\n<span lang="BG" style="font-family: Arial,sans-serif; background-color: #FFFFFF">\r\n<font size="4">Търговските мениджъри на Мечел Сървис България ще обработят \r\nВашето запитване и ще изпратят изготвената оферта във възможно най-кратък срок!</font></span></p>\r\n<p class="MsoNormal" align="left" style="line-height: 18.0pt; margin: 12.0pt 0cm; background: #F8F8F8">\r\n<span lang="BG" style="font-family: Arial,sans-serif; background-color: #FFFFFF">\r\n<font size="4">Това не е он-лайн магазин и тук плащания не се извършват!</font></span></p>', 'Начало', '', 'inherit', 'closed', 'closed', '', '211-revision-9', '', '', '2013-04-15 10:02:58', '2013-04-15 10:02:58', '', 211, 'http://metal-sales.tk/?p=246', 0, 'revision', '', 0),
