	(264, 1, '2013-04-15 10:27:13', '2013-04-15 10:27:13', '<p style="text-align: justify;"><b><span style="font-family: Verdana;">        Мечел Сървис България ЕООД</span></b><span style="font-family: Verdana;"> е компания с предмет на дейност внос и търговия на черни метали и металопродукция. Фирмата осъществява дейността си на територията на цялата страна, разполага със складови бази и търговски представителства в София, Русе и Бургас. </span></p>\r\n<p style="text-align: justify;"><span style="font-family: Verdana;">        На българския пазар компанията доставя пълна гама от висококачествени стоманени продукти, отговарящи изцяло на международните стандарти и предлага на своите партньори\r\nатрактивни цени, гъвкави условия на плащане и доставка, както и размери и количества по спецификации на клиентите.</span></p>\r\n<p style="text-align: justify;"><span style="font-family: Verdana;">    <b>    Мечел Сървис България ЕООД</b> е част от международната търговска компания Мечел Сървис Глобъл, която специализира дейността си в областта на продажбите, доставката и преработката на метални изделия. Като част от групата „Мечел” – една от водещите компании в областта на металургията и добивната промишленост, Мечел Сървис България е изключителен представител и доставчик за България на продукцията от всички металургични заводи на "Мечел".</span></p>', 'За нас', '', 'inherit', 'closed', 'closed', '', '2-revision-29', '', '', '2013-04-15 10:27:13', '2013-04-15 10:27:13', '', 2, 'http://metal-sales.tk/?p=264', 0, 'revision', '', 0),
